     const [plates, setPlates] = useState(menu)
    console.log(plates)
    return (
        <>
        <div className='container-plates'> 
        {plates.map((plate) => {
        return (<Plates
        key={plate.id}
        name={plate.name}
        price={plate.price}
        img={plate.img}
/>

